@hadleywickham With #rstats 4.1:
mtcars |&gt;
  subset(select = disp) |&gt;
  aggregate(by = list(cyl = mtcars$cyl), list) |&gt; 
  transform(mean = tapply(disp, cyl, FUN = \(x) mean(x[[1]]))) |&gt;
  transform(length = tapply(disp, cyl, FUN = \(x) length(x[[1]]))) |&gt;
  subset(select = -disp)

